__NUXT_JSONP__("/blocks/microcontroller_maker", (function(a,b){return {data:[{slug:"microcontroller_maker",text:"\u003Cspan\u003E\u003Cclient-only\u003E\u003Ch1\u003EMicrocontroller Maker\u003C\u002Fh1\u003E\n\u003Cp\u003E\u003CModInfoCard :blockData=\"block\" :img=\"img\" :title=\"title\" \u002F\u003E\u003C\u002Fp\u003E\n\u003Ch2\u003EDescription\u003C\u002Fh2\u003E\n\u003Cp\u003EA microcontroller maker can be used to generate pre-made microcontroller port templates.\u003C\u002Fp\u003E\n\u003Ch2\u003EUsage\u003C\u002Fh2\u003E\n\u003Cp\u003E\u003CWikiImage caption=\"Microcontroller Maker GUI\" src=\"\u002Fimg\u002Fmuc_maker_gui.png\" \u002F\u003E\u003C\u002Fp\u003E\n\u003Cp\u003EWhen placed, right click the microcontroller maker to open the GUI. The GUI opens only if the player is in Creative mode, and has the proper permissions. An outline will be\ndrawn in the world; this is the bounding box of the area of the generated microcontroller.\u003C\u002Fp\u003E\n\u003Cp\u003EA piston cannot move this block.\u003C\u002Fp\u003E\n\u003Cp\u003EIn the GUI, there is a &quot;Prev&quot; and &quot;Next&quot; button to change the microcontroller type, as well as a rotation toggle to change the placement orientation.\nWhen clicking &quot;Done&quot; settings will be saved; clicking &quot;Cancel&quot; will cancel any changes made.\u003C\u002Fp\u003E\n\u003Cp\u003ETo actually place the microcontroller blocks, power the microcontroller maker with redstone.\u003C\u002Fp\u003E\n\u003Ch2\u003ETemplate Format\u003C\u002Fh2\u003E\n\u003Cp\u003ETemplates are stored under \u003Ccode\u003Edata\u002Fkontrol\u002Fmuc_schematics\u002F*.muc\u003C\u002Fcode\u003E. An example template is as follows:\u003C\u002Fp\u003E\n\u003Cpre\u003E\u003Ccode\u003Ec8051\n.. .. .. .. 01 CO 02 .. .. .. ..\n.. .. .. .. 03 CO 04 06 08 10 12\n05 07 09 11 13 CO .. .. .. .. ..\n.. .. .. .. .. CO 14 16 18 20 ..\n.. 15 17 19 21 CO .. .. .. .. ..\n.. .. .. .. .. CO 22 24 26 28 30\n.. 23 25 27 29 CO .. .. .. .. ..\n.. 31 33 35 37 CO 32 34 36 38 ..\n\u003C\u002Fcode\u003E\u003C\u002Fpre\u003E\n\u003Cp\u003EThe first line is the ID of the schematic, all following lines must constitute a rectangular matrix with each block seperated by a space:\u003C\u002Fp\u003E\n\u003Ctable class=\"wiki_table\"\u003E\u003Cthead\u003E\n\u003Ctr\u003E\u003Cth\u003ESymbol\u003C\u002Fth\u003E\u003Cth\u003EMeaning\u003C\u002Fth\u003E\u003C\u002Ftr\u003E\n\u003C\u002Fthead\u003E\n\u003Ctbody\u003E\n\u003Ctr\u003E\u003Ctd\u003E\u003Ccode\u003E..\u003C\u002Fcode\u003E\u003C\u002Ftd\u003E\u003Ctd\u003EEmpty space\u003C\u002Ftd\u003E\u003C\u002Ftr\u003E\n\u003Ctr\u003E\u003Ctd\u003E\u003Ccode\u003ECO\u003C\u002Fcode\u003E\u003C\u002Ftd\u003E\u003Ctd\u003EPort connector\u003C\u002Ftd\u003E\u003C\u002Ftr\u003E\n\u003Ctr\u003E\u003Ctd\u003E\u003Ccode\u003EBase 10 number\u003C\u002Fcode\u003E\u003C\u002Ftd\u003E\u003Ctd\u003EPort with that port ID\u003C\u002Ftd\u003E\u003C\u002Ftr\u003E\n\u003C\u002Ftbody\u003E\n\u003C\u002Ftable\u003E\n\u003Ch2\u003EData Values\u003C\u002Fh2\u003E\n\u003Ch3\u003EID\u003C\u002Fh3\u003E\n\u003Ctable class=\"wiki_table\"\u003E\u003Cthead\u003E\n\u003Ctr\u003E\u003Cth\u003EName\u003C\u002Fth\u003E\u003Cth\u003E\u003Ca href=\"https:\u002F\u002Fminecraft.fandom.com\u002Fwiki\u002FNamespaced_ID\"\u003ENamespaced ID\u003C\u002Fa\u003E\u003C\u002Fth\u003E\u003Cth\u003EForm\u003C\u002Fth\u003E\u003Cth\u003ETranslation Key\u003C\u002Fth\u003E\u003C\u002Ftr\u003E\n\u003C\u002Fthead\u003E\n\u003Ctbody\u003E\n\u003Ctr\u003E\u003Ctd\u003EMicrocontroller Maker\u003C\u002Ftd\u003E\u003Ctd\u003E\u003Ccode\u003Ekontrol:muc_maker\u003C\u002Fcode\u003E\u003C\u002Ftd\u003E\u003Ctd\u003EBlock &amp; Item\u003C\u002Ftd\u003E\u003Ctd\u003E\u003Ccode\u003Eblock.kontrol.muc_maker\u003C\u002Fcode\u003E\u003C\u002Ftd\u003E\u003C\u002Ftr\u003E\n\u003C\u002Ftbody\u003E\n\u003C\u002Ftable\u003E\n\u003Ctable class=\"wiki_table\"\u003E\u003Cthead\u003E\n\u003Ctr\u003E\u003Cth\u003EName\u003C\u002Fth\u003E\u003Cth\u003E\u003Ca href=\"https:\u002F\u002Fminecraft.fandom.com\u002Fwiki\u002FNamespaced_ID\"\u003ENamespaced ID\u003C\u002Fa\u003E\u003C\u002Fth\u003E\u003C\u002Ftr\u003E\n\u003C\u002Fthead\u003E\n\u003Ctbody\u003E\n\u003Ctr\u003E\u003Ctd\u003EBlock entity\u003C\u002Ftd\u003E\u003Ctd\u003E\u003Ccode\u003Ekontrol:muc_maker\u003C\u002Fcode\u003E\u003C\u002Ftd\u003E\u003C\u002Ftr\u003E\n\u003C\u002Ftbody\u003E\n\u003C\u002Ftable\u003E\n\u003Ch3\u003EBlock data\u003C\u002Fh3\u003E\n\u003Cp\u003EMicrocontroller maker stores additional data in the form of a block entity:\u003C\u002Fp\u003E\n\u003Cp\u003E\u003CWikiTree icon=\"nbt\u002Fcompound.png\" :data=\"block_entity_data\" title=\"\u003Cb\u003EBlock entity data\u003C\u002Fb\u003E\" \u002F\u003E\u003C\u002Fp\u003E\n\u003C\u002Fclient-only\u003E\u003C\u002Fspan\u003E",img:"block\u002Fmuc_maker.png",block:{renewable:a,stackable:64,tools:[],blastResistance:3600000,hardness:-1,luminant:0,luminantToggle:a,transparent:a,flammable:a,catchesFireFromLava:a},title:"Microcontroller Maker",block_entity_data:[{icon:b,title:"rotationIndex:",text:"Index of the current rotation, from \u003Ccode\u003EBlockRotation.values()\u003C\u002Fcode\u003E"},{icon:b,title:"currentMUC:",text:"Index of the currently selected microcontroller"}]}],fetch:{},mutations:void 0}}(false,"nbt\u002Fint.png")));